    <div className={s.root}>
      <div className={s.container}>
        <p>Наши социальные сети</p>
        <div className={s.link}>
          <ul>
            {links.map((link) => (
              <Link link={link} key={link.id} />
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default SocialNet;
